import React from 'react';
import './CSS/result.css'
import sha256 from 'js-sha256'

class Result extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            data: props.data,
        };
        this.handleData = this.handleData.bind(this);
    }

    componentWillReceiveProps(props) {
        this.setState({ data: props.data });
    }

    handleData(name) {
        if (!(name in this.state.data)) return;
        let res = [];
        let data = this.state.data[name];
        for (let i in data) res.push(<tr id={sha256(i)}>{i}:{data[i]}</tr>);
        return res;
    }

    other(items) {
        let ser = 0;
        let res = [], temp = [];
        for (let i of items) {
            if (ser % 3 === 0) {
                res.push(<tr>{[...temp]}</tr>);
                temp = []; ser = 0;
            }
            temp.push(<td>{i}</td>);
            ser++;
        }
        return res;
    }

    render() {
        console.log(this.state.data.basic);
        for(let i in this.state.data.basic)console.log(this.state.data.basic[i]);
        return (<div className='result'>
            <div className='title'>结果</div>
            <table className='resultTable'>
                <tbody>
                    <tr>
                        <th colSpan={2}>基本信息</th>
                        <td><image/></td>
                    </tr>
                </tbody>
                <tbody>
                    <tr colSpan={3}><th>学术能力</th></tr>
                    {this.handleData('Academic')}
                    <tr colSpan={3}><th>社交能力</th></tr>
                    {this.handleData('Social')}
                    <tr colSpan={3}><th>一般能力</th></tr>
                    {this.handleData('Normal')}
                </tbody>
            </table>
            <div className='backgroundStory'>

            </div>
        </div>);
    }
}

export default Result;
